}i:158;a:1:{s:12:"created_time";i:1599240724;}i:159;a:1:{s:7:"caption";s:833:"Estupenda pista de @jccapel en una nueva casa de comidas puesta al día.

Sitios agradable, carta corta pero equilibrada y con un gran arroz

- croquetas de huevo duro con anchoas. Buenas
- media noche con pescadilla rebozada y salsa tártara. Muy curiosa y muy jugosa

- costillas de conejo adobadas y fritas. Como pipas. Para comer mil.

- arroz seco de carrillera, panceta y champiñones. Nivelón de arroz en estas latitudes. Muy muy muy rico. Fondo, arroz y sabor. Genial.

